const myImage = new Image();
const imgSrc = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
];
myImage.src = imgSrc[Math.floor(Math.random() * imgSrc.length)];
myImage.src = imgSrc[2];

myImage.addEventListener("load", () => {
  const canvas = document.querySelector(".about__img__card");
  const ctx = canvas.getContext("2d");

  canvas.width = 400;
  canvas.height = 400;
  if (window.width <= 1100) {
    canvas.width = 350;
    canvas.height = 350;
  }
  if (window.width <= 568) {
    canvas.width = 280;
    canvas.height = 280;
  }

  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let particlesArr = [];
  let numberOfParticles = 1000;

  let mappedImage = [];
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];

      const brightness = calculateRelativeBrigthness(red, green, blue);
      const cell = [
        (cellBrightness = brightness),
        (cellColor = `rgb(${red}, ${green}, ${blue})`),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  function calculateRelativeBrigthness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 1.5 + 1;
      this.positionX = Math.floor(this.x);
      this.positionY = Math.floor(this.y);
    }

    update() {
      this.positionX = Math.floor(this.x);
      this.positionY = Math.floor(this.y);
      this.speed = mappedImage[this.positionY][this.positionX][0];
      this.movement = 2.5 - this.speed + this.velocity;
      this.size = this.speed * 1.5;

      this.x += this.movement;
      // this.y += this.movement;

      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
        ctx.fill();
      }
      if (this.x >= canvas.width) {
        this.x = 0;
        this.y = Math.random() * canvas.height;
        ctx.fill();
      }
    }

    draw() {
      // ctx.fillStyle = mappedImage[this.positionY][this.positionX][1];
      ctx.fillStyle = "#edf5e1";

      ctx.beginPath();
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }

  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particlesArr.push(new Particle());
    }
  }
  init();

  function animate() {
    ctx.globalAlpha = 0.01;
    ctx.fillStyle = "#131313";
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    for (let i = 0; i < numberOfParticles; i++) {
      particlesArr[i].update();
      ctx.globalAlpha = particlesArr[i].speed * 0.5;
      particlesArr[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});
